11-29 10:48:37',1,'2024-11-29 15:41:06',0),(38,'','灭活罐工艺',2,135,'10h','工艺标签',1,'用于病毒灭活的专用设备，通常应用于生物制药过程中处理液体或悬浮液，以保证病毒被有效灭活，同时保留产品活性。主要用于生产高风险药物（如血液制品、疫苗、抗体等）中的病毒失活步骤。','物料加注，灭活操作，参数监控，灭活结束',1,'2024-11-29 10:50:22',NULL,NULL,0),(39,'','篮式反应器工艺',3,136,'10h','工艺标签',1,'主要用于生物制药、化工及其他工业中，用于物料的混合、反应及溶解操作。设备通常由罐体、搅拌装置、温控系统（夹套加热或冷却）、压力控制系统等组成。','物料加入，加热或冷却反应，反应过程中搅拌控制，液体或固体分离与过滤，清洗与设备复位。',1,'2024-11-29 10:53:17',1,'2024-11-29 16:38:31',1),(40,'','超低温冰箱获取毒种',2,134,'15min','易冻伤',1,'穿戴适当的个人防护装备，包括防寒手套（最好是厚的、隔热的手套，以防止手部冻伤）、实验服等；准备好用于转移实验耗材的工具，如预冷的镊子（如果需要夹取小型耗材，如小瓶、小管等）。','操作前准备：人员防护，工具准备；开启冰箱门，查找目标毒种；使用工具取出，转移至保温容器；关闭冰箱，处理耗材。',1,'2024-12-03 15:37:36',NULL,NULL,0),(41,'','生物隔离器传递仓处理',3,134,'30min','无菌操作',0,'记录操作过程和设备状态。包括操作的内容、使用的材料、设备是否出现异常情况等信息，为后续的实验分析和设备维护提供参考','设备检查；物品准备；人员准备；无菌操作；操作规范；内部清理；设备维护',1,'2024-12-03 15:41:38',NULL,NULL,0),(42,'','生物隔离器主舱体处理',4,134,'20min','无菌操作',1,'检查生物隔离器的完整性。查看隔离器的外壳是否有损坏、裂缝或泄漏的迹象。确保隔离器的手套完好无损，没有破损、裂缝或老化','在隔离器内进行操作时，要严格遵守无菌操作原则。如果不小心接触到非无菌表面，应该立即更换工具或对工具进行消毒处理。',1,'2024-12-03 15:44:39',NULL,NULL,0),(43,'','123',1,126,'12h','213',0,'123','213',1,'2024-12-04 14:34:53',NULL,NULL,1);
