INSERT INTO `manage_equipment` VALUES (1,'108-A-ATC-001',NULL,'高压蒸汽灭菌柜','M-005','山东新华','2023-10-13','湿热灭菌：通过高温饱和蒸汽对物品进行灭菌，蒸汽与物品接触时会释放大量潜热，使微生物的蛋白质、核酸等重要生物大分子变性，从而达到灭菌效果','灭菌阶段温度均匀性达到 ±1℃ - ±3℃','一层废液灭活间','8A101',NULL,'柜内温度',1,'2024-11-29 07:49:49',NULL,'2024-11-29 07:49:49',0,NULL),(2,'108-UT-PAT-007',NULL,'VHP传递窗','M-023','中科圣杰','2024-05-26','尘埃粒子数等指标严格符合相应净化级别标准','对于≥0.5μm 的尘埃粒子，高效空气过滤器（HEPA）的过滤效率可达到 99.97% 以上','一层废液灭活间','8A101',NULL,'舱内过氧化氢浓度',1,'2024-11-29 07:49:49',NULL,'2024-11-29 07:49:49',0,NULL),(3,'108-D-ITNK-001',NULL,'灭活罐','K-09','东富龙','2023-10-13','搅拌轴密封采用进口卫生级机械密封，搅拌转速为 36-53 转 / 分，也可采用变频调速器控制','具有精确的温度控制功能，通常采用数显温度计，控制范围较广，如 0℃-160℃，控制精度可达 ±0.1℃左右；工作压力通常在 0.1MPa-0.85MPa 之间','层析纯化间A','8D207',NULL,'罐内压力/罐内温度',1,'2024-11-29 07:49:49',NULL,'2024-11-29 07:49:49',0,NULL),(4,'108-D-ATC-001',NULL,'高压蒸汽灭菌柜','K084','新华','2023-10-13','湿热灭菌：通过高温饱和蒸汽对物品进行灭菌，蒸汽与物品接触时会释放大量潜热，使微生物的蛋白质、核酸等重要生物大分子变性，从而达到灭菌效果','灭菌阶段温度均匀性达到 ±1℃ - ±3℃','走廊（层析纯化A区）-普通走廊','8D208-8R237',NULL,'罐内温度',1,'2024-11-29 07:49:49',NULL,'2024-11-29 07:49:49',0,NULL),(5,'108-L-ISL-001',NULL,'隔离器','W234','上海东富龙','2024-05-26','尘埃粒子数等指标严格符合相应净化级别标准','对于≥0.5μm 的尘埃粒子，高效空气过滤器（HEPA）的过滤效率可达到 99.97% 以上','三层病毒培养灭活区1','8L306',NULL,'舱内过氧化氢浓度',1,'2024-11-29 07:49:49',NULL,'2024-11-29 07:49:49',0,NULL),(6,'108-L-BTR-001',NULL,'300L篮式反应器','L098','上海日泰','2023-10-13','耐温范围达到 - 30℃ - 200℃ ','具有精确的温度控制功能，通常采用数显温度计，控制范围较广，如 0℃-160℃，控制精度可达 ±0.1℃左右；工作压力通常在 0.1MPa-0.85MPa 之间','三层病毒培养灭活区1','8L306',NULL,'罐内压力/罐内温度    ',1,'2024-11-29 07:49:49',NULL,'2024-11-29 07:49:49',0,NULL),(7,'108-N-HTNK-001',NULL,'收获罐','L793','上海东富龙','2023-10-13','耐温范围达到 - 30℃ - 200℃ ','容量在 5 - 20 升，高度精度控制在 ±2 - 10mm，压力在 0.1 - 0.5MPa 之间','三层病毒培养灭活区2','8N306',NULL,'罐内压力/罐内温度',1,'2024-11-29 07:49:49',NULL,'2024-11-29 07:49:49',0,NULL),(8,'108-N-FRZ-001',NULL,'超低温冰箱','C794','海尔','2023-10-13','温度方面：制冷最低可达 -40℃至 -150℃甚至更低，控温精度 ±0.1℃ - ±1℃，以精准维持低温保存环境','最低温度可以达到 - 150℃，温度控制精度为 ±0.1℃ - ±1℃，门封的密封压力为 10 - 30N/m','三层病毒培养灭活区2','8N306',NULL,'冰箱内温度',1,'2024-11-29 07:4