CREATE TABLE `manage_equipment_inspection_manual` (
  `manual_id` bigint NOT NULL AUTO_INCREMENT COMMENT '手册ID',
  `equipment_id` bigint NOT NULL COMMENT '设备ID',
  `suitable_scope` varchar(255) DEFAULT NULL COMMENT '适用范围',
